import { Fragment, useContext } from 'react';
import { ProductContext } from '../../components/contexts/product.context';

const Shop = () => {
  const { products } = useContext(ProductContext);
  return (
    <div>
      {products.map(({ id, name }) => (
        <Fragment key={id}>
          <h1>{name}</h1>
        </Fragment>
      ))}
    </div>
  );
};

export default Shop;
